import React from "react";
import styled from "styled-components";
import eye from "./eye.png";

const Eyebtn = styled.div`
  display: flex;
  position: relative;
  background: #f16603;
  z-index: 100;
  text-align: center;
  color: #fff;
  margin: 25px 25px -25px 25px;
  width: 50px;
  height: 50px;    transition: all ease-in-out 0.2s;

  border-radius: 5px;
  box-shadow: rgba(60, 64, 67, 0.3) 0px 1px 2px 0px,
    rgba(60, 64, 67, 0.15) 0px 2px 3px 2px;
  &:hover {
    width: 55px;
    height: 55px;  margin: 25px 25px -30px 25px;

    transition: all ease-in-out 0.2s;
  }
`;
const Eyetxt = styled.div`
  width: 100%;
  justify-content: center;
  align-items: center;
  padding: 3px;
`;
const Eyeimg = styled.img`
  width: 30px;
  height: auto;
  margin: 0px 0px -10px 0px;
`;


function TheEyebtn() {
  return (
                    <Eyebtn>
                      <a ></a>
                      <Eyetxt>
                        <Eyeimg src={eye} alt="eye" />
                        <div>App</div>
                      </Eyetxt>
                    </Eyebtn>
  );
}

export default  TheEyebtn;
